import React from 'react';



const MenuList = ({menu}) => {


  return (

    <article className='block'>
      
      <img src={menu.img} alt={menu.title}/>

<div className='info'>

<div className='header'>
<p>{menu.title}</p>

<h3>{menu.price}</h3>

</div>

<p>{menu.desc}</p>


</div>


    </article>
  );
}

export default MenuList;
